INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (2, "調子が上がって\nきたなっ", "vo_minigame_1013_icon_2_002_001", 2, 1, 2, "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_1_002_001", 3000, 1000);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (2, "ほらほら、\nまだいけるだろ？", "vo_minigame_1013_icon_2_003_001", 2, 2, 2, "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_1_003_001", 3000, 5000);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (2, "へへっ、おまえら\nやるじゃねえか！", "vo_minigame_1013_icon_2_004_001", 3, 3, 2, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_1_004_001", 3000, 10000);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (2, "あたしたちはまだ\n止まらねえぜ！", "vo_minigame_1013_icon_2_005_001", 3, 4, 3, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_1_005_001", 3000, 10000);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (2, "見てろよ！\nマコト班の快進撃だ！", "vo_minigame_1013_icon_2_005_002", 3, 5, 3, "まだまだ行きます\nついてきなさい", "vo_minigame_1013_icon_1_005_002", 3000, 10000);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (2, "うおぉぉっ！\n絶好調だぜ！", "vo_minigame_1013_icon_2_005_003", 3, 6, 3, "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_1_005_003", 3000, 10000);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (2, "どこまで行けるか\n楽しみだなっ！", "vo_minigame_1013_icon_2_006_001", 3, 7, 4, "ここからは\n前人未到の領域です！", "vo_minigame_1013_icon_1_006_001", 3000, 0);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (3, "まだ諦めんなよっ", "vo_minigame_1013_icon_2_007_001", 4, 8, 5, "厄介でしたわ…", "vo_minigame_1013_icon_1_007_001", 1000, 1);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (3, "冷やっとしたぜ…！", "vo_minigame_1013_icon_2_007_002", 4, 9, 5, "油断大敵です", "vo_minigame_1013_icon_1_007_002", 1000, 1);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (3, "弱音を吐くなっ", "vo_minigame_1013_icon_2_007_003", 4, 10, 5, "忌々しいっ…", "vo_minigame_1013_icon_1_007_003", 1000, 1);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (4, "マコト班集合！", "vo_minigame_1013_icon_2_008_001", 3, 11, 6, "大所帯ですわね", "vo_minigame_1013_icon_1_008_001", 1500, 99);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (4, "連携してくぞ！", "vo_minigame_1013_icon_2_008_002", 3, 12, 6, "エリコ班へようこそ", "vo_minigame_1013_icon_1_008_002", 1500, 99);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (1, "みんなに力を！", "vo_minigame_1013_icon_2_020_001", 6, 13, 8, "ナナカちゃんに\nお任せあれ", "vo_minigame_1013_icon_1_020_001", 3000, 0);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (1, "任せてくれたまえ", "vo_minigame_1013_icon_2_022_001", 7, 14, 9, "はっはっは！\n任せろ！", "vo_minigame_1013_icon_1_022_001", 3000, 0);
INSERT INTO `v1_36b232c703d386c42394a8f6c0e4b212b010467696dcd07e541b83c322b89a17` VALUES (1, "ほな、いきまひょか", "vo_minigame_1013_icon_2_023_001", 8, 15, 10, "どんどんいくわよ", "vo_minigame_1013_icon_1_023_001", 3000, 0);
